import React from 'react'
import "../css/collabs.css"

export default function Collaborating() {
    return (
        <div className="collab__main">
            <h1>Collaborators</h1>
            <p>DSC collaborating in DSC WOW</p>
            <iframe title="DSC Collaborating in DSC WOW" src="https://www.google.com/maps/d/embed?mid=1F9Lyn8xgdMJwGUWr-BC1rjKVVeZTlv3A" width="100%" height="480"></iframe>
        </div>
    )
}
